import React, { useEffect, useRef } from "react";
import { gsap } from "gsap";

const Preloader = ({ onComplete }) => {
  const logoRef = useRef(null);

  useEffect(() => {
    const tl = gsap.timeline({
      onComplete: () => {
        onComplete && onComplete(); // Call the onComplete callback when the animation finishes
      },
    });

    tl.to(logoRef.current, {
      y: -50,
      duration: 0.5,
      ease: "power1.out",
      repeat: 2,
      yoyo: true,
    })
      .to(logoRef.current, {
        y: 0,
        duration: 0.5,
        ease: "bounce.out",
      })
      .to(logoRef.current, {
        opacity: 0,
        duration: 0.3,
        ease: "power1.out",
        delay: 0.5,
      });
  }, [onComplete]);

  return (
    <div className="fixed inset-0 bg-black flex justify-center items-center z-50">
      <div
        ref={logoRef}
        className="logo w-16 h-16 flex items-center justify-center"
      >
        {/* Add your logo or a letter */}
        {/* <span className="text-black text-xl font-bold">Logo</span> */}
        <div>
          <svg
            width="212"
            height="127"
            viewBox="0 0 212 127"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
            xmlns:xlink="http://www.w3.org/1999/xlink"
          >
            <rect width="212" height="127" fill="url(#pattern0_142_17)" />
            <defs>
              <pattern
                id="pattern0_142_17"
                patternContentUnits="objectBoundingBox"
                width="1"
                height="1"
              >
                <use
                  xlink:href="#image0_142_17"
                  transform="matrix(0.000244141 0 0 0.000407542 0 -0.00148022)"
                />
              </pattern>
              <image
                id="image0_142_17"
                width="4096"
                height="2461"
                xlink:href="data:image/png;base64,"
              />
            </defs>
          </svg>
        </div>
      </div>
    </div>
  );
};

export default Preloader;
